char pinyinFirstLetter(unsigned short hanzi)
{
	int index = hanzi - HANZI_START;
	if (index >= 0 && index <= HANZI_COUNT)
	{
		return firstLetterArray[index];
	}
	else if((hanzi >= 'a' && hanzi <= 'z')||
            (hanzi >= 'A' && hanzi <= 'Z'))
    {
        return hanzi;
    }
    else
	{
		return '#';
	}
}


